import React from 'react';
import logo from './assets/img/logo.png';
import './style/App.scss';
import StandardLayout from './layouts/StandardLayout';
import { BrowserRouter as Router, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App">
      <StandardLayout>
        Hello Home
      </StandardLayout>
    </div>
    </Router>
  );
}

export default App;
